import React from "react";
import "react-quill/dist/quill.snow.css";
import ReactQuill from "react-quill";
import { Card, CardBody, CardImg, Form, FormInput, Button, Input, CardHeader } from "shards-react";
import AdminDashboard from ".";
import "./CSS/addBlog.css";
import "./CSS/addJob.css";

import AdminFooter from "./admin-footer";
import RangeSalary from "./rangeSalary";
import cardImage from "../img/code-820275.jpg";

function AddJob() {
  return (
    <div>
      <AdminDashboard />
      <div>.</div>
      <Card small className="addForm">
        <div className="form-title">POST A NEW JOB</div>

        <CardBody>
          <Form className="add-new-post">
            <FormInput
              size="lg"
              className="job-col1"
              placeholder="Job Title"
            />
            {/* <div>Validity</div> */}
            <FormInput
              size="lg"
              className="mb-3 job-col1 job"
              placeholder="Validity"
              type="date"
            />

            <RangeSalary />
            {/* <Input/> */}
            {/* <CardHeader>Image Preview</CardHeader> */}
                <CardImg src={cardImage} className="JobImage"/>

            <ReactQuill
              className="add-new-post__editor mb-1"
              placeholder="Description of the Job here"
            />
          </Form>
        </CardBody>
        <div className="publish">
          <button className="publish-btn">Publish</button>
        </div>
      </Card>

      {/* <div style={{textAlign:"center"}}>Test</div> */}
      <AdminFooter />
    </div>
  );
}

export default AddJob;
